MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The Calibre layout viewers provide a powerful scripting capability using the Tcl-based batch commands. The phrase Calibre layout viewers is used throughout this manual when referring to the family of layout viewer tools which include Calibre DESIGNrev, Calibre WORKbench, Calibre LITHOview, and Calibre MDPview.");
MGCAddSnippet(6, "The Calibre layout viewers include a full version of Tcl that you can use to develop custom scripts for automating frequently performed tasks and extending the functionality of the layout view tools. ");
MGCAddSnippet(7, "Tcl is rarely mentioned without Tk because of the close relationship between the two. Tcl is the language used to write scripts, while Tk is the toolkit of building blocks used to build graphical user interfaces for Tcl programs. Tk is basically an extension to Tcl.");
MGCAddSnippet(8, "One of the reasons Tcl/Tk is used so widely is that it is relatively easy to create extensions to the language. Tk was the first extension created. Many other publicly available extensions have been created since. ");
MGCAddSnippet(9, "When working with Tcl, there are some basic concepts you should be familiar with. These include Tcl syntax, characters with special meaning, comments, and variables.");
MGCAddSnippet(10, "Tclsh is a shell-like application that reads Tcl commands from standard input or from a file and evaluates them. The tclsh is useful for becoming familiar with Tcl syntax and trying out Tcl commands.");
MGCAddSnippet(11, "Tcl is an easy to learn, simple programming language. There are some basic syntax conventions to follow when writing Tcl scripts.");
MGCAddSnippet(12, "In Tcl, you use the  #  symbol (referred to as the pound sign or hashtag) to denote the start of a comment. This symbol directs the Tcl compiler to not evaluate the rest of the line. ");
MGCAddSnippet(13, "In Tcl scripts, some characters have a special meaning.");
MGCAddSnippet(14, "A Tcl list is an ordered collection of numbers, words, strings, or other lists. The Tcl language allows you to create a list in different ways.");
MGCAddSnippet(15, "Variables are extremely useful to utilize when writing Tcl scripts because they are reusable and context independent. When writing Tcl scripts for a layout viewer, you can use the handle assigned by the layout viewer to refer a specific object. However, handles are system-generated by the layout viewer and are not always intuitive. Instead of using the handle, it is typically easier to assign a variable to the handle because you can choose the variable name and then use it anytime you want to refer to a specific object.");
MGCAddSnippet(16, "");
MGCAddSnippet(17, "Layout viewer objects include the window, layouts, overlays, and views. When you create or open an object in a layout viewer, the layout viewer assigns a system-generated instance name to the object. This system-generated instance name is referred to as a handle. An example of an instance name, or handle, is layout0. The layout viewer maintains this handle in memory during the layout viewer session. Each handle is unique and applies to one and only one specific object.");
MGCAddSnippet(18, "The layout viewers support the use of commands and object methods for manipulating the layout viewer application, current layout, current view, and other state-dependent data.");
MGCAddSnippet(19, "All Tcl objects have handles. The Calibre layout viewer classes of Tcl objects include cwbWorkBench, Layout, Peek, Overlay, StringFeature, and cwbLayoutView. Many layout database objects are not Tcl objects. Within memory, these layout database objects are actually stored as elements of Tcl objects.");
MGCAddSnippet(20, "You can write Tcl-based scripts in the supported application extension files to create customized macros or modify the behavior of the Calibre layout viewers.");
MGCAddSnippet(21, "This section provides answers to some frequently asked questions about using Tcl.");
MGCAddSnippet(22, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(23, "Calibre DESIGNrev provides multiple options for running the tool, depending on whether you want to work in the layout viewer GUI, execute a Tcl script, or simply execute a command. These options include: Interactive GUI, Interactive shell, Batch, Batch GUI, and Command.");
MGCAddSnippet(24, "There are multiple options available for invoking Calibre DESIGNrev and issuing Tcl commands.");
MGCAddSnippet(25, "The interactive GUI provides access to both the layout viewer and the terminal (or shell) window. You invoke the interactive GUI whenever you issue a layout viewer executable without specifying a script or the -a or ‑shell arguments.");
MGCAddSnippet(26, "When you invoke the interactive shell, you have access only to the shell window. While you can create and manipulate layout data, you cannot view it. Instead, you see descriptions of the data, reported in the shell window.");
MGCAddSnippet(27, "Batch refers to the processing of a script containing commands that are executed on one or more files. In the case of the Calibre layout viewers, a batch script contains Tcl commands and is typically executed on layout data.");
MGCAddSnippet(28, "With the batch GUI option, both the Tcl and Tk packages are available when performing batch processing.");
MGCAddSnippet(29, "You can use the (non‑interactive) command option to evaluate a single Tcl command and then exit. This option does not execute any Tk commands or any of the layout viewer commands that require a GUI.");
MGCAddSnippet(30, "The Calibre tools are compatible with shared libraries (compiled for the correct host platform). You can use the Tcl load command as part of a Tcl script you run in a Calibre layout viewer, to specify a path to the shared library.");
MGCAddSnippet(31, "Three different examples explore the differences you encounter when performing a single task using a layout viewer invocation option.");
MGCAddSnippet(32, "In this example, you invoke Calibre DESIGNrev in shell mode and use Tcl to generate a list of the cells in a layout.");
MGCAddSnippet(33, "In this example, you work with a layout that is loaded into the Calibre DESIGNrev GUI. Ignore the fact that the application displays the names of the cells in the layout for you. The lines of code you learn here are needed elsewhere.");
MGCAddSnippet(34, "In this example, instead of typing the Tcl commands at a prompt, you write them in an ASCII file, save the file, and then pass the file to Calibre DESIGNrev.");
MGCAddSnippet(35, "Two examples are used to explore the basics of writing procedures, using examples that display an entire layout hierarchy.");
MGCAddSnippet(36, "In this example, you create a simple procedure to write the layout hierarchy. The Tcl commands used in this example include open, puts, set, proc, foreach, and read. ");
MGCAddSnippet(37, "In this example, you write a script that writes the layout hierarchy for any layout file, regardless of how many levels there are in the hierarchy. You do this by writing a procedure that traverses the hierarchy until it can go no further. Explanations follow the example code.");
MGCAddSnippet(38, "This section provides answers to some frequently asked questions about using the layout viewer tools and Tcl.");
MGCAddSnippet(39, "Tcl scripts are stand-alone programs you write using the Tcl language, plus any extensions you have available to you. For the Calibre layout viewer tools, Tcl scripts are written using the layout viewer Tcl extensions and batch commands.");
MGCAddSnippet(40, "You can execute Tcl scripts in batch or interactive mode.");
MGCAddSnippet(41, "Layout generation and assembly takes existing cells or layout files and modifies or combines them. You can create Tcl scripts to automate this process. ");
MGCAddSnippet(42, "You can create a Tcl script for generating a new layout using batch commands.");
MGCAddSnippet(43, "You can use a Tcl script to generate a new layout and accept command line arguments that specify the name of the topcell, a layer number, the coordinates of a polygon, and the name to use for saving the new GDS layout. ");
MGCAddSnippet(44, "You can use a Tcl script to introduce errors and then find and fix them for a more realistic programming experience. You also anticipate possible user errors and build in error handling for those situations.");
MGCAddSnippet(45, "You can use batch commands to move the origin of the topcell in an existing layout.");
MGCAddSnippet(46, "You can create a Tcl script that takes an existing GDS file as input, renames the cells using the specified prefix, and outputs the results to the specified GDS file.");
MGCAddSnippet(47, "Macros are application extensions you write to add new functionality to a Calibre layout viewer application, such as Calibre DESIGNrev. You can then make the extensions accessible from the Macros menu. ");
MGCAddSnippet(48, "One of the many uses for macros is to provide access to the many Calibre batch tools (such as DRC, LVS, the RET batch tools), essentially making them interactive from the graphical user interface. However, you can use macros to perform many other functions as well.");
MGCAddSnippet(49, "You can write a command procedure to invoke another application or perform data manipulation. The macro command procedure must be GUI-independent. It relies on the GUI plug-in to pass it the proper user input.");
MGCAddSnippet(50, "The GUI plug-in defines how the macro interacts with the graphical user interface. Typically, the plug-in detects state-dependent information or queries for user input and then invokes the macro command procedure. It can also display data returned by the macro command procedure.");
MGCAddSnippet(51, "You register the macro with the tool using the Macros create command, which also assigns it a name and builds the functional macro from the macro command procedure and the GUI plug-in procedure. Once registered, the macro name can be placed on the layout viewer Macros menu as a menu item. ");
MGCAddSnippet(52, "Once the macro is registered, you can issue the Macros menu command to refresh the Macros menu so the new command is available to you.");
MGCAddSnippet(53, "This example converts a simple Tcl procedure into a macro and makes it available through the layout viewer Macros menu.");
MGCAddSnippet(54, "Examples are used to explore the process of creating a simple macro that writes the hierarchy of the current layout to a file the user specifies. ");
MGCAddSnippet(55, "This procedure describes how to turn a simple script into a command procedure. You learn about the requirements for a command procedure and how to source a Tcl script from the shell window. ");
MGCAddSnippet(56, "In this procedure you use the Tcl gets command to capture the keyboard data, the tk_getSaveFile Tk command to create a file browser widget, and then configure the file browser widget.");
MGCAddSnippet(57, "In this procedure you learn about passing arguments to a GUI plug-in and then invoking the command procedure from the GUI plug-in.");
MGCAddSnippet(58, "In this procedure you learn about the tk_messageBox command and using the backslash  \\  to continue a line.");
MGCAddSnippet(59, "In this procedure you use the Macros create command to register the macro with a Calibre layout viewer and then use the Macros menu command to add the registered macro to the Macros menu.");
MGCAddSnippet(60, "The code you have written thus far displays a message box telling you the hierarchy was written successfully to the file. In this procedure you modify the Tcl script to include some error handling capability. You use the Tcl catch command to track whether a script returns an error, add conditional statements using if and if … else, and then use the Tcl return command to exit the procedure.");
MGCAddSnippet(61, "In this procedure you define the order in which the layout viewer application evaluates scripts.");
MGCAddSnippet(62, "The complete code example of the write_hier.tcl file used in procedures is provided.");
MGCAddSnippet(63, "You can learn more about creating macros by studying some existing macros.");
MGCAddSnippet(64, "In this example, the macro command proc and the macro plug-in are simple to demonstrate the general syntax. The following Tcl procedure defines a macro that lists all layers present in the current layout viewer window to the terminal window. The layout peek command can also list layers, however the macro can be further personalized for specific customer cases.");
MGCAddSnippet(65, "The macro in this example is used to draw a circle. It creates a GUI interface that prompts for the information (radius, number of sides, and layer) that is used to draw the circle.");
MGCAddSnippet(66, "This example is more elaborate, and therefore better represents the usefulness of macro extension. This example demonstrates a macro that performs a simple DRC EXTERNAL spacing check in batch Calibre, and returns the results to the open layout session. To activate this macro, insert this code into the wbinit.tcl file.");
MGCAddSnippet(67, "Q: Must I really create two separate procedures to make a macro?");
MGCAddSnippet(68, "This chapter contains reference pages for the layout viewer batch commands and object methods. The reference pages are organized into sections based on function (command or object method), and the object type they are designed to operate on (cwbWorkBench, layout, overlay, peek, cwbLayoutView, and StringFeature). This chapter includes reference pages for Macro commands that you use to create, delete, and manipulate macros in the layout viewers. ");
