MGCAddSnippet(259, "Typically, the Calibre layout viewers are accessed using the Calibre DESIGNrev GUI. Alternatively, layout viewer batch commands can be used. Additionally, these commands can be combined into stand-alone programs called scripts. Scripts are a simple way to string together a series of batch commands for execution together. It is often useful to develop a script interactively, to see the output of each command as you step through them.");
MGCAddSnippet(260, "The batch commands for the Calibre layout viewers are Tcl-based commands, providing access to internal application functions. Executing batch commands for the Calibre layout viewers involves working with the Calibre layout viewer extensions to Tcl. ");
MGCAddSnippet(261, "Calibre DESIGNrev writes batch command results to the terminal window, where your results can be studied. However, because extracting information from a layout database often involves several commands, results can be spread out and difficult to analyze. Writing to a file solves this problem by allowing you to view your results without any extraneous information.");
